  \"2016-02-29T05:55:06.741445\",\n\t\"name\": \"dissolved-inorganic-carbon-ph-alkalinity-temperature-salinity-and-other-variables-collected-froce5b6\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0109927 includes discrete
  sample and profile data collected from HESPERIDES in the North Atlantic Ocean and
  South Atlantic Ocean from 2010-04-05 to 2010-05-16. These data include CHLOROFLUOROCARBON-11
  (CFC-11), CHLOROFLUOROCARBON-12 (CFC-12), DELTA HELIUM-3, DISSOLVED INORGANIC CARBON
  (DIC), DISSOLVED OXYGEN, HELIUM, HYDROSTATIC PRESSURE, NEON, NITRATE, Potential
  temperature (theta), SALINITY, TOTAL ALKALINITY (TA), WATER TEMPERATURE, pH, phosphate
  and silicate. The instruments used to collect these data include Alkalinity titrator,
  CTD, Coulometer for DIC measurement, bottle and spectrophotometer.nnThese data were
  collected by Fiz Perez, J.L. Pelegri, Noelia Fajar, Elisa F. Guallart and Aida F.
  Rios of Instituto de Investigaciones Marinas de Vigo as part of the CLIVAR_A06_2010
  data set. CDIAC associated the following cruise ID(s) with this data set: CLIVAR_A06_2010nnThe
  International CLIVAR Global Ocean Carbon and Repeat Hydrography Program carries
  out a systematic and global re-occupation of select WOCE/JGOFS hydrographic sections
  to quantify changes in storage and transport of heat, fresh water, carbon dioxide
  (CO2), and related parameters.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
